import { Layout ,Text , useTheme, Select, SelectItem,IndexPath, Icon} from '@ui-kitten/components';
import React from 'react'
import { Dimensions,ScrollView,View   } from 'react-native'
import {LineChart} from "react-native-chart-kit";
export default function MyLineChart({ navigation, state }) {
    const theme = useTheme();
    const [selectedIndex, setSelectedIndex] = React.useState(new IndexPath(0));
    const [warehouse,setWarehouse] =React.useState(['Kho 1','Kho 2','Kho 3'])

    return (
    <Layout style={{flex:1,alignItems:'center'}} level='3'>
    <Select
        style={{width:'95%',marginTop:15,marginBottom:10}}
        selectedIndex={selectedIndex}
        value={warehouse[selectedIndex-1]}
        onSelect={index => setSelectedIndex(index)}>
        <SelectItem title='Kho 1'/>
        <SelectItem title='Kho 2'/>
        <SelectItem title='Kho 3'/>
    </Select>
        <View style={{backgroundColor: theme['background-basic-color-4'],width:'95%',borderRadius:10,padding:5}}>
            <Text style={{marginLeft:4,marginTop:10}}>Khu vực 1</Text>
            <LineChart
                withInnerLines={false}
                data={{
                labels: ["January", "February", "March", "April", "May", "June"],
                datasets: [
                    {
                    data: [
                        Math.random() * 100,
                        Math.random() * 100,
                        Math.random() * 100,
                        Math.random() * 100,
                        Math.random() * 100,
                        Math.random() * 100
                    ]
                    }
                ]
                }}
                width={Dimensions.get("window").width*0.9} // from react-native
                height={220}
                yAxisLabel="$"
                yAxisSuffix="k"
                yAxisInterval={1} // optional, defaults to 1
                bezier
                style={{
                marginVertical: 15,
                borderRadius: 5
                }}
                chartConfig={{
                    backgroundColor: "#000000",
                    backgroundGradientFrom: theme['background-basic-color-4'],
                    backgroundGradientTo: theme['background-basic-color-4'],
                    decimalPlaces: 2, // optional, defaults to 2dp
                    color:(lever)=> theme['color-primary-default'],
                    labelColor:(lever)=> theme['text-basic-color'],
                    style: {
                    borderRadius: 16
                    },
                    propsForDots: {
                    r: "2",
                    strokeWidth: "4",
                    stroke: theme['color-primary-default']
                    }
                }}
            />        
        </View>
        <View style={{height:100,marginTop:15,width:'100%'}}>
            <ScrollView horizontal contentContainerStyle={{paddingHorizontal:10}} showsHorizontalScrollIndicator={false}>
                <View style={{backgroundColor: theme['color-primary-focus'],padding:15,borderRadius:20,marginHorizontal:5}}>
                    <Text  >Khu vực 1</Text>
                   
                </View>
                <View style={{backgroundColor: theme['background-basic-color-4'],padding:20,borderRadius:20,marginHorizontal:5}}>
                    <Text >Khu vực 2</Text>
                </View>
                <View style={{backgroundColor: theme['background-basic-color-4'],padding:20,borderRadius:20,marginHorizontal:5}}>
                    <Text >Khu vực 3</Text>
                </View>
                <View style={{backgroundColor: theme['background-basic-color-4'],padding:20,borderRadius:20,marginHorizontal:5}}>
                    <Text >Khu vực 4</Text>
                </View>
                <View style={{backgroundColor: theme['background-basic-color-4'],padding:20,borderRadius:20,marginHorizontal:5}}>
                    <Text >Khu vực 5</Text>
                </View>
                <View style={{backgroundColor: theme['background-basic-color-4'],padding:20,borderRadius:20,marginHorizontal:5}}>
                    <Text >Khu vực 6</Text>
                </View>
            </ScrollView>
        </View>
    </Layout>
       
    )
}
